import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";

function RestaurantDashboard(props){
  return(
  <div className="card mb-3">
  <img src={props.image} className="card-img-top" alt="restaurant-img" />
  <div className="card-body">
    <h5 className="card-title">{props.restaurantName}</h5>
    <p className="card-text">{props.descriptionAndAddress}</p>
    <p className="card-text"><small className="text-muted">{props.address}</small></p>
   </div>
  </div>
  );
}


export default RestaurantDashboard;
